e=\"\u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u0430\u044f \u0410\u0440\u0430\u0431\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u0430\u044f \u0410\u0440\u0430\u0431\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430<\/a> \u0440\u0430\u0441\u043f\u0430\u043b\u0430\u0441\u044c \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B3%D0%B8%D0%BF%D0%B5%D1%82\" title=\"\u0415\u0433\u0438\u043f\u0435\u0442\">\u0415\u0433\u0438\u043f\u0435\u0442<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D1%80%D0%B8%D1%8F\" title=\"\u0421\u0438\u0440\u0438\u044f\">\u0421\u0438\u0440\u0438\u044e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1972_%D0%B3%D0%BE%D0%B4\" title=\"1972 \u0433\u043e\u0434\">1972<\/a>&#160;\u2014 \u043b\u0435\u0433\u0435\u043d\u0434\u0430\u0440\u043d\u0430\u044f \u043f\u043e\u0431\u0435\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B1%D0%BE%D1%80%D0%BD%D0%B0%D1%8F_%D0%A1%D0%A1%D0%A1%D0%A0_%D0%BF%D0%BE_%D1%85%D0%BE%D0%BA%D0%BA%D0%B5%D1%8E_%D1%81_%D1%88%D0%B0%D0%B9%D0%B1%D0%BE%D0%B9\" title=\"\u0421\u0431\u043e\u0440\u043d\u0430\u044f \u0421\u0421\u0421\u0420 \u043f\u043e \u0445\u043e\u043a\u043a\u0435\u044e \u0441 \u0448\u0430\u0439\u0431\u043e\u0439\">\u0441\u0431\u043e\u0440\u043d\u043e\u0439 \u0421\u0421\u0421\u0420 \u043f\u043e \u0445\u043e\u043a\u043a\u0435\u044e \u0441 \u0448\u0430\u0439\u0431\u043e\u0439<\/a> \u043d\u0430\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B1%D0%BE%D1%80%D0%BD%D0%B0%D1%8F_%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D1%8B_%D0%BF%D0%BE_%D1%85%D0%BE%D0%BA%D0%BA%D0%B5%D1%8E_%D1%81_%D1%88%D0%B0%D0%B9%D0%B1%D0%BE%D0%B9\" title=\"\u0421\u0431\u043e\u0440\u043d\u0430\u044f \u041a\u0430\u043d\u0430\u0434\u044b \u043f\u043e \u0445\u043e\u043a\u043a\u0435\u044e \u0441 \u0448\u0430\u0439\u0431\u043e\u0439\">\u0441\u0431\u043e\u0440\u043d\u043e\u0439 \u041a\u0430\u043d\u0430\u0434\u044b<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D0%BF%D0%B5%D1%80%D1%81%D0%B5%D1%80%D0%B8%D1%8F_%D0%A1%D0%A1%D0%A1%D0%A0_%E2%80%94_%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0_(1972)\" title=\"\u0421\u0443\u043f\u0435\u0440\u0441\u0435\u0440\u0438\u044f \u0421\u0421\u0421\u0420 \u2014 \u041a\u0430\u043d\u0430\u0434\u0430 (1972)\">\u0421\u0443\u043f\u0435\u0440\u0441\u0435\u0440\u0438\u0438 \u0421\u0421\u0421\u0420&#160;\u2014 \u041a\u0430\u043d\u0430\u0434\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1978_%D0%B3%D0%BE%D0%B4\" title=\"1978 \u0433\u043e\u0434\">1978<\/a>&#160;\u2014 \u041e\u0442\u043f\u0440\u0430\u0437\u0434\u043d\u043e\u0432\u0430\u043b\u0438 \u0441\u0432\u0430\u0434\u044c\u0431\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D1%80%D1%80%D0%B8%D1%81%D0%BE%D0%BD,_%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B6\" title=\"\u0425\u0430\u0440\u0440\u0438\u0441\u043e\u043d, \u0414\u0436\u043e\u0440\u0434\u0436\">\u0414\u0436\u043e\u0440\u0434\u0436 \u0425\u0430\u0440\u0440\u0438\u0441\u043e\u043d<\/a> \u0438 \u041e\u043b\u0438\u0432\u0438\u044f \u0422\u0440\u0438\u043d\u0438\u0434\u0430\u0434 \u0410\u0440\u0438\u0430\u0441 (Olivia Trinidad Arias). \u041e\u043b\u0438\u0432\u0438\u044f, \u0440\u043e\u0434\u0438\u0432\u0448\u0430\u044f\u0441\u044f \u0432 \u041c\u0435\u043a\u0441\u0438\u043a\u0435, \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432\u0441\u0442\u0440\u0435\u0442\u0438\u043b\u0430\u0441\u044c \u0441 \u0414\u0436\u043e\u0440\u0434\u0436\u0435\u043c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1974_%D0%B3%D0%BE%D0%B4\" title=\"1974 \u0433\u043e\u0434\">1974 \u0433\u043e\u0434\u0443<\/a>. \u0412 \u0437\u0430\u043f\u0438\u0441\u0438 \u0430\u043b\u044c\u0431\u043e\u043c\u0430 \u00abDark Horse\u00bb \u043e\u043d\u0430 \u0443\u0447\u0430\u0441\u0442\u0432\u043e\u0432\u0430\u043b\u0430 \u043a\u0430\u043a \u0431\u044d\u043a-\u0432\u043e\u043a\u0430\u043b\u0438\u0441\u0442\u043a\u0430. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1_%D0%B0%D0%B2%D0%B3%D1%83%D1%81%D1%82%D0%B0\" title=\"1 \u0430\u0432\u0433\u0443\u0441\u0442\u0430\">1 \u0430\u0432\u0433\u0443\u0441\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1978_%D0%B3%D0%BE%D0%B4\" title=\"1978 \u0433\u043e\u0434\">1978 \u0433\u043e\u0434\u0430<\/a> \u0443 \u043d\u0438\u0445 \u0440\u043e\u0434\u0438\u043b\u0441\u044f \u0441\u044b\u043d \u0414\u0445\u0430\u043d\u0438 (Dhani Harrison).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1986_%D0%B3%D0%BE%D0%B4\" title=\"1986 \u0433\u043e\u0434\">1986<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u043a\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BC%D0%B8%D1%82,_%D0%9A%D1%8D%D1%82%D0%B8\" title=\"\u0421\u043c\u0438\u0442, \u041a\u044d\u0442\u0438\">\u041a\u044d\u0442\u0438 \u0421\u043c\u0438\u0442<\/a> (Cathy Smith) \u043f\u0440\u0438\u0433\u043e\u0432\u043e\u0440\u0435\u043d\u0430 \u043a \u0442\u0440\u0451\u043c \u0433\u043e\u0434\u0430\u043c \u0442\u044e\u0440\u044c\u043c\u044b \u0437\u0430 \u043d\u0435\u043f\u0440\u0435\u0434\u043d\u0430\u043c\u0435\u0440\u0435\u043d\u043d\u043e\u0435 \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u043e \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u0430\u043a\u0442\u0451\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D1%83%D1%88%D0%B8,_%D0%94%D0%B6%D0%BE%D0%BD\" title=\"\u0411\u0435\u043b\u0443\u0448\u0438, \u0414\u0436\u043e\u043d\">\u0414\u0436\u043e\u043d\u0430 \u0411\u0435\u043b\u0443\u0448\u0438<\/a>, \u0443\u043c\u0435\u0440\u0448\u0435\u0433\u043e \u043e\u0442 \u043f\u0435\u0440\u0435\u0434\u043e\u0437\u0438\u0440\u043e\u0432\u043a\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%80%D0%BA%D0%BE%D1%82%D0%B8%D0%BA%D0%B8\" class=\"